import React from 'react';
import { Link } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <header>
        <div className="logo">B-Rate</div>
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/foodtrucks">Food Trucks</Link></li>
            <li><Link to="/dininghall">Dining Halls</Link></li>
            <li><Link to="/contact">Contact</Link></li>
            <li><Link to="/about">About</Link></li>
          </ul>
        </nav>
        <div className="toggle-icon">&#9776;</div>
      </header>
      <h1>Welcome to Bruin Rate</h1>
    </div>
  );
}

export default App;
